INSERT INTO public.movie (id,certification,description,"name",director,image) VALUES
	 (-9983,2,'L''histoire de Derek qui, voulant venger la mort de son père, entraine son jeune frère, Danny, dans la spirale de la haine','American History X','Tony Kaye','american-history-x.jpg'),
	 (-9960,3,'''You met me at a very strange time in my life''','Fight Club','David Fincher','fight-club.jpg'),
	 (-9946,1,'La fabuleuse histoire de la vie de Forrest Gump et les événements qu''il traverse dans l''Amérique de la seconde moitié du 20e siècle','Forrest Gump','Robert Zemeckis','forrest-gump.jpg'),
	 (-9934,1,'Dom Cobb arrive à s''approprier les secrets les plus précieux d''un individu, enfouis au plus profond de son subconscient, pendant qu''il rêve et que son esprit est particulièrement vulnérable','Inception','Christopher Nolan','inception.jpg'),
	 (-9926,2,'Arthur Fleck bascule peu à peu dans la folie pour devenir le Joker, un dangereux tueur psychotique.','Joker','Todd Phillips','joker.jpg'),
	 (-9906,1,'L''histoire d''amour entre Sebastian Wilder, pianiste passionné de jazz et Mia Dolan, actrice en devenir','La La Land','Damien Chazelle','lalaland.jpg'),
	 (-9898,2,'Une adaptation cinématographique du roman-feuilleton du même nom de Stephen King','La ligne verte','Frank Darabont','la-ligne-verte.jpg'),
	 (-9892,2,'Un tueur à gages répondant au nom de Léon prend sous son aile Mathilda, une petite fille de 12 ans, seule rescapée du massacre de sa famille','Léon','Luc Besson','leon.jpg'),
	 (-9884,1,'Deux magiciens du 19e siècle s''engagent dans une lutte sans merci pour se surpasser l''un l''autre','Le prestige','Christopher Nolan','le-prestige.jpg'),
	 (-9873,1,'Leonard n''a qu''une idée en tête : traquer l''homme qui a violé et assassiné sa femme afin de se venger','Memento','Christopher Nolan','memento.jpg');
INSERT INTO public.movie (id,certification,description,"name",director,image) VALUES
	 (-9867,1,'''Guess you guys aren''t ready for that yet... but your kids are gonna love it''','Retour vers le futur','Robert Zemeckis','retour-vers-le-futur.jpg'),
	 (-9847,1,'il ne s''agit pas d''un voyage dans le temps, mais d''un renversement temporel','Tenet','Christopher Nolan','tenet.jpg'),
