	 (-9805,1,'Ambitieux et perfectionniste, Andrew, 19 ans, rêve de devenir le meilleur batteur de jazz de sa génération','Whiplash','Damien Chazelle','whiplash.jpg'),
	 (-9779,1,'Mitsuha, adolescente coincée dans une famille traditionnelle, rêve de quitter ses montagnes natales pour découvrir la vie trépidante de Tokyo','Your name','Makoto Shinkai','your-name.jpg'),
	 (-9754,1,'Batman contre Bane','The Dark Knight rises','Christopher Nolan','dark-knight-rises.jpg'),
	 (-9730,1,'Batman est plus que jamais déterminé à éradiquer le crime organisé qui sème la terreur en ville','The Dark Knight','Christopher Nolan','the-dark-knight.jpg'),
	 (-9722,1,'L''histoire du général romain Maximus, arrêté, condamné à mort et devenu gladiateur','Gladiator','Ridley Scott','gladiator.jpg'),
	 (-9699,2,'le lieutenant Aldo Raine forme un groupe de soldats juifs américains pour mener des actions punitives particulièrement sanglantes contre les nazis','Inglourious Basterds','Quentin Tarantino','inglourious-basterds.jpg'),
	 (-9679,1,'Les aventures d''un groupe d''explorateurs qui utilise une faille récemment découverte dans l''espace-temps','Interstellar','Christopher Nolan','interstellar.jpg');
